import CompMenu from './CompMenu';
import { Outlet } from 'react-router-dom';
import CompMenuBiz from './CompMenuBiz';
import CompMenuAbout from './CompMenuAbout';

const CompSideBar = () => {
  return (
    <aside>
      <hr />
      <p>
        sidebar
      </p>      
<ul>
        <CompMenuAbout/>
        <CompMenuBiz/>
</ul>
    </aside>
  );
};

export default CompSideBar;
